import styled from 'styled-components'

export const HeaderWrapper = styled.div`
  position: relative;
  height: 56px;
  border-bottom: 1px solid #f0f0f0;
`;

export const Logo = styled.a`
  position: absolute;
  height: 58px;
  top:0;
  left:0;
     width:100px

`;
